import React, {useState} from 'react';
import {Navbar} from "../../components/forHome/navbar";
import EventsTable from "../../components/forAdmin/eventsTable";
import Sidebar from "../../components/forAdmin/sidebar";
import AddIcon from '@mui/icons-material/Add';
import {Button} from "@mui/material";
import DeleteConfirmationDialog from "../../components/forAdmin/deleteConfirmationDialog";
function Dashboard({user, isAuthenticated}) {

    const [isOpen, setIsOpen] = useState(false);
    const openModal = () => setIsOpen(true);
    const closeModal = () => setIsOpen(false);

    //setTimeout(protect, 120);

    /*function protect()
    {
        if (!isAuthenticated && user == null)
            return (<Navigate to={"/"}/>)
    }*/

    return (
        <div>
            <header>
                <Sidebar />
                <div
                    id="intro"
                    className="bg-image"
                    style={{
                        background: "whitesmoke",
                        "height": "100vh"
                    }}
                >
                    <div className="mask text-white mt-4">
                        <div className="container">
                            <div className="mt-5">
                                <h2 className="text-center m-2" style={{color: '#1976d2'}}>Events</h2>
                                <div className="mb-1 d-flex justify-content-end">
                                    <Button variant="contained" startIcon={<AddIcon />}>
                                        New event
                                    </Button>
                                </div>
                                <EventsTable/>
                            </div>
                        </div>
                    </div>
                </div>
            </header>
        </div>
    );
}

export default Dashboard;
